import React, { createContext, useState, useContext, useEffect } from 'react';
import axios from 'axios';

const API_URL = process.env.REACT_APP_API_URL || 'http://localhost:5000/api';

const AuthContext = createContext();

export const useAuth = () => useContext(AuthContext);

export const AuthProvider = ({ children }) => {
  const [user, setUser] = useState(null);
  const [loading, setLoading] = useState(true);
  const [token, setToken] = useState(localStorage.getItem('token'));

  useEffect(() => {
    const initAuth = async () => {
      console.log('üîç AUTH: Initializing authentication...');
      const storedToken = localStorage.getItem('token');
      console.log('üîç AUTH: Stored token:', storedToken ? 'Present' : 'Missing');

      if (storedToken) {
        try {
          console.log('üîç AUTH: Setting axios headers with token');
          axios.defaults.headers.common['Authorization'] = `Bearer ${storedToken}`;

          console.log('üîç AUTH: Fetching user info from /auth/me');
          const response = await axios.get(`${API_URL}/auth/me`);
          console.log('üîç AUTH: User fetch successful:', response.data.user.email);

          setUser(response.data.user);
          setToken(storedToken);
        } catch (error) {
          console.error('üîç AUTH: Token validation failed:', {
            status: error.response?.status,
            message: error.message,
            response: error.response?.data
          });
          // Token is invalid, clear it
          logout();
        }
      } else {
        console.log('üîç AUTH: No token found in localStorage');
      }
      setLoading(false);
    };

    initAuth();
  }, []);

  const login = async (email, password) => {
    console.log('üîç AUTH: Login attempt for:', email);
    try {
      console.log('üîç AUTH: Sending request to:', `${API_URL}/auth/login`);
      const response = await axios.post(`${API_URL}/auth/login`, { email, password });
      const { token, user } = response.data;

      console.log('üîç AUTH: Login successful, token received');
      console.log('üîç AUTH: User data:', user);

      // Store token
      localStorage.setItem('token', token);
      setToken(token);

      // Set axios default headers
      axios.defaults.headers.common['Authorization'] = `Bearer ${token}`;

      setUser(user);

      console.log('üîç AUTH: User set:', user.email);
      console.log('üîç AUTH: Axios headers set:', axios.defaults.headers.common);

      return { success: true };
    } catch (error) {
      console.error('üîç AUTH: Login error:', {
        message: error.message,
        response: error.response?.data,
        status: error.response?.status
      });
      return { 
        success: false, 
        error: error.response?.data?.error || 'Login failed' 
      };
    }
  };

  const register = async (userData) => {
    console.log('üîç AUTH: Registration attempt for:', userData.email);
    try {
      console.log('üîç AUTH: Sending request to:', `${API_URL}/auth/register`);
      console.log('üîç AUTH: Registration data:', { 
        ...userData, 
        password: '[HIDDEN]',
        encryptedPrivateKey: userData.encryptedPrivateKey?.substring(0, 50) + '...'
      });

      const response = await axios.post(`${API_URL}/auth/register`, userData);
      const { token, user } = response.data;

      console.log('üîç AUTH: Registration successful, token received');

      // Store token
      localStorage.setItem('token', token);
      setToken(token);

      // Set axios default headers
      axios.defaults.headers.common['Authorization'] = `Bearer ${token}`;

      setUser(user);

      return { success: true };
    } catch (error) {
      console.error('üîç AUTH: Registration error:', {
        message: error.message,
        response: error.response?.data,
        status: error.response?.status
      });

      const errorMessage = error.response?.data?.error || 
                          error.response?.data?.message ||
                          error.response?.data?.errors?.[0]?.msg ||
                          'Registration failed';

      return { 
        success: false, 
        error: errorMessage 
      };
    }
  };

  const logout = () => {
    console.log('üîç AUTH: Logging out...');
    localStorage.removeItem('token');
    delete axios.defaults.headers.common['Authorization'];
    setUser(null);
    setToken(null);
    console.log('üîç AUTH: Logout complete');
  };

  // Check if token exists
  const hasToken = !!localStorage.getItem('token');

  const value = {
    user,
    token,
    loading,
    login,
    register,
    logout,
    isAuthenticated: !!user && !!token,
    hasToken
  };

  console.log('üîç AUTH: Context value:', {
    user: value.user?.email,
    hasToken: value.hasToken,
    isAuthenticated: value.isAuthenticated,
    loading: value.loading
  });

  return (
    <AuthContext.Provider value={value}>
      {children}
    </AuthContext.Provider>
  );
};
